import 'dart:convert';

import 'agreed_negotiation.dart';

class EconomicEvaluation {
  int? numberOfChances;
  int? expectedPrice;
  int? profitPercent;
  int? totalExpectedTaxes;
  int? buyingPrice;
  int? rentingPrice;
  int? chancePrice;
  String? investmentTime;
  String? incomingTime;
  String? investmentMode;
  String? propertyManagement;
  AgreedNegotiation? agreedNegotiation;

  EconomicEvaluation({
    this.numberOfChances,
    this.expectedPrice,
    this.profitPercent,
    this.totalExpectedTaxes,
    this.buyingPrice,
    this.rentingPrice,
    this.chancePrice,
    this.investmentTime,
    this.incomingTime,
    this.investmentMode,
    this.propertyManagement,
    this.agreedNegotiation,
  });

  factory EconomicEvaluation.(
    Map<String, dynamic> data,
  ) {
    return EconomicEvaluation(
      numberOfChances: data['number_of_chances'] as int? ?? 0,
      expectedPrice: data['expected_price'] as int? ?? 0,
      profitPercent: data['profit_percent'] as int? ?? 0,
      totalExpectedTaxes: data['total_expected_taxes'] as int? ?? 0,
      buyingPrice: data['buying_price'] as int? ?? 0,
      rentingPrice: data['renting_price'] as int? ?? 0,
      chancePrice: data['chance_price'] as int? ?? 0,
      investmentTime: data['investment_time'] as String? ?? '',
      incomingTime: data['incoming_time'] as String? ?? '',
      investmentMode: data['investment_mode'] as String? ?? 'Balanced',
      propertyManagement: data['property_management'] as String? ?? 'rent',
      agreedNegotiation:
          data['agreed_negotiation'] == null
              ? null
              : AgreedNegotiation.(
                data['agreed_negotiation'] as Map<String, dynamic>,
              ),
    );
  }

  Map<String, dynamic>
  () {
    return {
      'number_of_chances': numberOfChances,
      'expected_price': expectedPrice,
      'profit_percent': profitPercent,
      'total_expected_taxes': totalExpectedTaxes,
      'buying_price': buyingPrice,
      'renting_price': rentingPrice,
      'chance_price': chancePrice,
      'investment_time': investmentTime,
      'incoming_time': incomingTime,
      'investment_mode': investmentMode,
      'property_management': propertyManagement,
      'agreed_negotiation':
          agreedNegotiation
              ?.(),
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [EconomicEvaluation].
  factory EconomicEvaluation.fromJson(String data) {
    return EconomicEvaluation.(
      json.decode(data) as Map<String, dynamic>,
    );
  }

  /// `dart:convert`
  ///
  /// Converts [EconomicEvaluation] to a JSON string.
  String toJson() => json.encode(
    (),
  );
}
